// Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faTwitter, faLinkedin } from '@fortawesome/free-brands-svg-icons';
import '../App.css'; 

const Dashboard = () => {
    // Create an array of positions for the bouncing circles
    const circlePositions = [
        { top: '50px', left: '20px' },
        { top: '100px', left: '150px' },
        { top: '150px', left: '300px' },
    ];

    return (
        <div className="dashboard">
            <h1>HR Management System</h1>
            <nav>
                <Link to="/employees">Manage Employees</Link>
                <Link to="/vehicles">Manage Vehicles</Link>
                <Link to="/development">Manage Professional Development</Link> 
            </nav>
            <p className="description">
                Welcome to the HR Management System! Here you can manage employees, vehicles, and professional development programs efficiently.
            </p>
            <div className="social-media-icons">
                <h3>Connect with us:</h3>
                <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
                    <FontAwesomeIcon icon={faFacebook} size="2x" style={{ margin: '0 10px' }} />
                </a>
                <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
                    <FontAwesomeIcon icon={faTwitter} size="2x" style={{ margin: '0 10px' }} />
                </a>
                <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">
                    <FontAwesomeIcon icon={faLinkedin} size="2x" style={{ margin: '0 10px' }} />
                </a>
            </div>
            {/* Render bouncing circles */}
            {circlePositions.map((position, index) => (
                <div 
                    key={index}
                    className="bouncing-circle"
                    style={{ top: position.top, left: position.left }} 
                />
            ))}
        </div>
    );
};

export default Dashboard;
